import React from 'react';
import logo from './logo.svg';
import './App.css';

import { ChakraProvider } from '@chakra-ui/react'
import LunchForm from './oppgave-2/LunchForm';

function App() {
  return (
    <ChakraProvider>
      <div className="App">
        <header className="App-header">
         <LunchForm/>
        </header>
      </div>
  </ChakraProvider>
  );
}

export default App;
